public class MS {

	private int max;
	private int min;

	public MS(int max, int min) {
		super();
		this.max = max;
		this.min = min;
	}

	public MS() {
		super();
		// TODO Auto-generated constructor stub
	}

	public int getMax() {
		return max;
	}

	public void setMax(int max) {
		this.max = max;
	}

	public int getMin() {
		return min;
	}

	public void setMin(int min) {
		this.min = min;
	}

}
